import React from 'react';
import './App.css';
import Navbar from './components/Navbar'
import { createMuiTheme, MuiThemeProvider } from '@material-ui/core/styles';

const Theme = createMuiTheme({
  palette: {
    primary: {
      light: '#4CC1E6',
      main: '#4CC1E6',
      dark: '#4CC1E6',
      contrastText: '#fff',
    },
    secondary: {
      light: '#4CC1E6',
      main: '#4CC1E6',
      dark: '#4CC1E6',
      contrastText: '#000',
    },
  },
});

function App() {
  return (
    <div>
      <MuiThemeProvider>
        <Navbar/>
      </MuiThemeProvider>
    </div>
  );
}

export default App;
